import * as React from "react";
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  ImageBackground,
  StatusBar,
  Image,
} from "react-native";
import Notifications from "../components/Notifications";
import { Color, FontFamily, Border, FontSize, Padding } from "../GlobalStyles";

const Inbox1 = () => {
  return (
    <View style={styles.inbox}>
      <View style={styles.header}>
        <Text style={styles.chats} />
        <Text style={styles.text} />
        <Notifications />
      </View>
      <ScrollView
        style={styles.scrollview}
        showsHorizontalScrollIndicator={false}
        showsVerticalScrollIndicator={false}
        contentContainerStyle={styles.scrollviewContent}
      >
        <View style={[styles.scrollviewInner, styles.topnavBg]}>
          <View style={styles.frameParent}>
            <View style={styles.downloadRemovebgPreview3Parent}>
              <ImageBackground
                style={styles.downloadRemovebgPreview3Icon}
                resizeMode="contain"
                source={require("../assets/downloadremovebgpreview3.png")}
              />
              <Text
                style={[styles.walletBalanceUpdated, styles.text1Typo]}
              >{`Wallet balance updated successfully. Check your available
balance, and your other account details`}</Text>
            </View>
            <Text style={[styles.text1, styles.text1Typo]}>11:10</Text>
          </View>
        </View>
      </ScrollView>
      <View style={[styles.header1, styles.header1Position]}>
        <StatusBar style={styles.topnavBg} barStyle="default" />
      </View>
      <View style={[styles.bottomview, styles.header1Position]}>
        <View style={[styles.bottomnav, styles.topnavBg]}>
          <Image
            style={styles.groupIcon}
            resizeMode="cover"
            source={require("../assets/HomeInactive.png")}
          />
          <Image
            style={[
              styles.iconsaxlinearprofile2user,
              styles.iconsaxlinearprofile2userSpaceBlock,
            ]}
            resizeMode="cover"
            source={require("../assets/iconsaxlinearprofile2user3.png")}
          />
          <Image
            style={[
              styles.iconsaxlinearmonitormobbile,
              styles.iconsaxlinearprofile2userSpaceBlock,
            ]}
            resizeMode="cover"
            source={require("../assets/iconsaxlinearmonitormobbile2.png")}
          />
          <Image
            style={[
              styles.iconsaxlinearmonitormobbile,
              styles.iconsaxlinearprofile2userSpaceBlock,
            ]}
            resizeMode="cover"
            source={require("../assets/iconsaxlinearmessage3.png")}
          />
          <Image
            style={styles.whatsappImage20230122At5Icon}
            resizeMode="cover"
            source={require("../assets/whatsapp-image-20230122-at-524-12.png")}
          />
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  scrollviewContent: {
    flexDirection: "column",
  },
  topnavBg: {
    backgroundColor: Color.white,
    flexDirection: "row",
  },
  text1Typo: {
    textAlign: "left",
    fontFamily: FontFamily.interRegular,
  },
  header1Position: {
    left: 0,
    position: "absolute",
  },
  iconsaxlinearprofile2userSpaceBlock: {
    overflow: "hidden",
    marginLeft: 53.5,
  },
  chats: {
    display: "none",
  },
  text: {
    marginLeft: 40,
    display: "none",
  },
  header: {
    top: 115,
    left: 87,
    alignItems: "center",
    flexDirection: "row",
    position: "absolute",
  },
  downloadRemovebgPreview3Icon: {
    width: 30,
    height: 30,
    borderRadius: Border.br_81xl,
  },
  walletBalanceUpdated: {
    fontSize: FontSize.size_xs,
    color: Color.black,
  },
  downloadRemovebgPreview3Parent: {
    flexDirection: "row",
  },
  text1: {
    fontSize: FontSize.size_3xs,
    color: Color.gray_400,
    marginTop: 16,
  },
  frameParent: {
    justifyContent: "flex-end",
    alignItems: "flex-end",
  },
  scrollviewInner: {
    width: 392,
    padding: Padding.p_3xs,
    alignItems: "flex-end",
  },
  scrollview: {
    top: 143,
    left: 1,
    position: "absolute",
    flex: 1,
  },
  header1: {
    top: 0,
  },
  groupIcon: {
    height: 22,
    width: 20,
  },
  iconsaxlinearprofile2user: {
    height: 20,
    marginLeft: 53.5,
    width: 20,
  },
  iconsaxlinearmonitormobbile: {
    width: 24,
    height: 24,
    marginLeft: 53.5,
  },
  whatsappImage20230122At5Icon: {
    width: 31,
    height: 31,
    marginLeft: 53.5,
    borderRadius: Border.br_81xl,
  },
  bottomnav: {
    height: 60,
    paddingHorizontal: Padding.p_12xl,
    paddingVertical: Padding.p_mini,
    alignItems: "center",
  },
  bottomview: {
    top: 792,
  },
  inbox: {
    backgroundColor: Color.whitesmoke_100,
    width: "100%",
    height: 852,
    flex: 1,
  },
});

export default Inbox1;
